import React from 'react';
import TodoItem from './TodoItem';

const TodoCollection = (
  todos,
  onToggleDone,
  onSave,
  onDelete,
  onChangeMode,
) => {
  return (
    <div>
      {todos.map((todo) => {
        return <TodoItem key={todo.id} todo={todo} />;
      })}
    </div>
  );
};

export default TodoCollection;
